import Head from "next/head";
import Filter from "./Components/Filter";
import React, { Component } from "react";

import {
  Container,
  Row,
  Col,
  Navbar,
  Nav,
  NavDropdown,
  Form,
  FormControl,
  Button,
} from "react-bootstrap";

class Home extends Component {
  state = {};

  render() {
    return (
      <>
        <Head>
          <title>Create Next App</title>
          <link rel="icon" href="/favicon.ico" />
        </Head>
        <div style={{ backgroundColor: "lightgrey" }}>
          <Container className="container-fluid">
            <Row className="pt-5">
              <Col className="my-auto">
                <Filter />
              </Col>
              <Col className="">
                <h1 className="display-2 font-weight-bolder">
                  <strong>Next.JS + Bootstrap</strong>
                </h1>
              </Col>
            </Row>
          </Container>
        </div>
      </>
    );
  }
  static async getInitialProps() {
    const res = await fetch(
      "https://api.spacexdata.com/v3/launches?limit=100&amp;launch_success=true&amp;land_success=true&amp;launch_year=2014"
    );
    const data = await res.json();
    let launch_year = Object.keys(data).map((value) => ({
      launch_year: value.launch_year,
      value,
    }));
    return {
      data,
      launch_year,
    };
  }
}

export default Home;
